con:config.script:
def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )

def XmlHolderObj = groovyUtils.getXmlHolder( 'Login#Response' )

def sessionId = XmlHolderObj.getNodeValue('//sessionid/text()')

def Project_LevelContext = testRunner.testCase.testSuite.project

Project_LevelContext.setPropertyValue("PrpSessionId",sessionId)

def returnedSes = Project_LevelContext.getPropertyValue("PrpSessionId")
log.info returnedSes

log.info context.expand ('${#Project#PrpSessionId}')

log.info context.expand ('${#Global#Environment}')

